import Link from 'next/link';
import '../styles/header.scss';
const Header = ()=>
{
    return(
        <div className="Header_Container">
            <div className="Header_Logo">Logo</div>
            <ul>
                <li><Link className="active Link" href="#home">Acceuil</Link></li>
                <li><Link className="active Link" href="#news">A propos </Link></li>
                <li><Link className="active Link" href="#contact">Temoignages</Link></li>
                <li><Link className="active Link" href="#about">Contact</Link></li>
                <li><Link className="active Link" href="#about">Questions</Link></li>
            </ul>
            <div className="Header_Buttons">
                <button className="Header_subscribe">S'inscrire</button>
                <button className="Header_signin">Se connecter</button>
            </div>
        </div>
    )
}

export default  Header ;
